        /**
         * The transition table of the DFA
         */
        private val ZZ_TRANS = zzUnpackTrans()
        private const val ZZ_TRANS_PACKED_0 =
            "\u0001\u0002\u0002\u0003\u0001\u0004\u0001\u0005\u0001\u0004\u0001\u0006\u0001\u0007\u0002\u0008" +
                "\u0001\u0009\u0001\u000a\u0001\u000b\u0001\u0004\u0001\u000c\u0001\u000d\u0001\u000e\u0001\u0004" +
